<h3 class="header">KLAUZULA INFORMACYJNA O PRZETWARZANIU DANYCH OSOBOWYCH</h3>

<div class="t1">
<div class="contener">

W zwiazku z realizacja wymogow Rozporzadzenia Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osob fizycznych w zwiazku z przetwarzaniem danych osobowych ; w sprawie swobodnego przeplywu takich danych oraz uchylenia dyrektywy 95/46/WE (ogolne rozporzadzenie o ochronie danych "RODO"), informujemy o zasadach przetwarzania Pani/Pana danych osobowych oraz o przyslugujacych Pani/Panu prawach z tym  zwiazanych. Ponizsze zasady stosuje sie poczawszy od 25 maja 2018 roku.<br />Pelny tekst podpisany przez Wojta jest zamieszczony w Komunikatach na tej stronie.
</div>
</div>

